import React from "react";
import "./App.css";
import Nav from "./Nav";

function App() {
  return (
    <div className="appContainer">
      <Nav />
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/Movie">
          <Movie />
        </Route>
        <Route path="/Reviews">
          <Reviews />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
